import React from "react";

const WorkoutContainer= () =>{
    return(
<div className="workout">
<div>
<p>Rs 1600/-</p>
</div>
<div>
<img src='https://hips.hearstapps.com/hmg-prod/images/happy-male-athlete-listening-music-on-treadmill-in-royalty-free-image-1580752391.jpg' alt="cardio"/>
</div>
<div>
  <span>Cardio</span>
  <h3>Weight Loss</h3>
</div>
</div>
    );
}

export default WorkoutContainer;
